import React, { useState, useEffect } from 'react';
import './EndScreen.css';

const EndScreen = ({ sessionData, difficulty, onRestart }) => {
  const [accuracy, setAccuracy] = useState(0);
  const [metrics, setMetrics] = useState(null);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const calculateResults = async () => {
      try {
        const response = await fetch('http://localhost:5001/api/results/calculate', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ sessionData })
        });

        const data = await response.json();
        setAccuracy(data.accuracy);
        setMetrics(data.metrics);
      } catch (error) {
        console.error('Error calculating results:', error);
      } finally {
        setIsLoading(false);
      }
    };

    calculateResults();
  }, [sessionData]);

  const handleDownload = () => {
    const dataStr = JSON.stringify(sessionData, null, 2);
    const dataBlob = new Blob([dataStr], { type: 'application/json' });
    const url = URL.createObjectURL(dataBlob);
    const link = document.createElement('a');
    link.href = url;
    link.download = `session_${sessionData.id}_${new Date().getTime()}.json`;
    link.click();
  };

  const handleDownloadCSV = () => {
    // CSVヘッダー
    const headers = ['timestamp', 'posX', 'posY', 'rotX', 'rotY', 'gazeX', 'gazeY', 'gazeObject'];
    const csvContent = [
      headers.join(','),
      ...sessionData.sensorData.map(d =>
        [
          d.timestamp,
          d.position.x,
          d.position.y,
          d.rotation.x,
          d.rotation.y,
          d.gaze.x,
          d.gaze.y,
          d.gaze.object
        ].join(',')
      )
    ].join('\n');

    const dataBlob = new Blob([csvContent], { type: 'text/csv' });
    const url = URL.createObjectURL(dataBlob);
    const link = document.createElement('a');
    link.href = url;
    link.download = `sensor_data_${sessionData.id}_${new Date().getTime()}.csv`;
    link.click();
  };

  const getDifficultyLabel = () => {
    const labels = {
      easy: '低ストレス（簡単）',
      medium: '程よいストレス（中級）',
      hard: '高ストレス（難しい）'
    };
    return labels[difficulty] || difficulty;
  };

  return (
    <div className="end-screen">
      <div className="end-container">
        {isLoading ? (
          <div className="loading">
            <div className="spinner"></div>
            <p>結果を計算中...</p>
          </div>
        ) : (
          <>
            {/* タイトル */}
            <h1>ゲーム終了</h1>
            <p className="subtitle">お疲れ様でした!</p>

            {/* 結果サマリー */}
            <div className="results-summary">
              <div className="result-card">
                <div className="result-label">正答率</div>
                <div className="result-value">{accuracy.toFixed(1)}%</div>
                <div className="result-count">
                  ({sessionData.quizResponses.filter(q => q.isCorrect).length} / {sessionData.quizResponses.length})
                </div>
              </div>

              <div className="result-card">
                <div className="result-label">難易度</div>
                <div className="result-value">{getDifficultyLabel()}</div>
              </div>

              <div className="result-card">
                <div className="result-label">解いた問題数</div>
                <div className="result-value">{sessionData.quizResponses.length}</div>
              </div>
            </div>

            {/* 計測指標表示 */}
            {metrics && (
              <div className="metrics-section">
                <h2>計測指標</h2>
                <div className="metrics-grid">
                  {Object.entries(metrics).map(([key, value]) => {
                    let displayValue = value;
                    if (typeof value === 'object') {
                      displayValue = `${value.mean?.toFixed(3) || 0} (±${value.stdDev?.toFixed(3) || 0})`;
                    } else {
                      displayValue = typeof value === 'number' ? value.toFixed(3) : value;
                    }

                    return (
                      <div key={key} className="metric-item">
                        <div className="metric-label">{key}</div>
                        <div className="metric-value">{displayValue}</div>
                      </div>
                    );
                  })}
                </div>
              </div>
            )}

            {/* ダウンロードボタン */}
            <div className="download-section">
              <h3>データをダウンロード</h3>
              <div className="button-group">
                <button className="download-button" onClick={handleDownload}>
                  セッションデータ (JSON)
                </button>
                <button className="download-button" onClick={handleDownloadCSV}>
                  センサーデータ (CSV)
                </button>
              </div>
            </div>

            {/* アクション */}
            <div className="action-buttons">
              <button className="restart-button" onClick={onRestart}>
                もう一度プレイ
              </button>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default EndScreen;
